import React, { useState, useEffect } from 'react';
import { Button, Card, List, message, Modal } from 'antd';
import { useNavigate } from 'react-router-dom';

const TestOrderPage: React.FC = () => {
  const navigate = useNavigate();
  const [orders, setOrders] = useState<any[]>([]);
  
  // 加载订单数据
  useEffect(() => {
    loadOrders();
  }, []);
  
  // 从localStorage加载订单
  const loadOrders = () => {
    try {
      const ordersStr = localStorage.getItem('orders');
      if (ordersStr) {
        const parsedOrders = JSON.parse(ordersStr);
        console.log('加载到的订单数据:', parsedOrders);
        setOrders(parsedOrders);
      } else {
        console.log('没有订单数据');
        setOrders([]);
      }
    } catch (error) {
      console.error('加载订单数据失败:', error);
      setOrders([]);
    }
  };
  
  // 取消订单
  const handleCancelOrder = (orderId: string) => {
    Modal.confirm({
      title: '确认取消订单',
      content: `您确定要取消订单 ${orderId} 吗？`,
      onOk: () => {
        try {
          // 查找订单
          const orderIndex = orders.findIndex(o => o.id === orderId);
          if (orderIndex !== -1) {
            // 更新订单状态
            const updatedOrders = [...orders];
            updatedOrders[orderIndex].status = 'CANCELLED';
            
            // 保存到localStorage
            localStorage.setItem('orders', JSON.stringify(updatedOrders));
            
            // 更新状态
            setOrders(updatedOrders);
            
            message.success('订单已取消');
          } else {
            message.error('未找到订单');
          }
        } catch (error) {
          console.error('取消订单失败:', error);
          message.error('取消订单失败');
        }
      }
    });
  };
  
  // 创建测试订单
  const handleCreateTestOrder = () => {
    const newOrder = {
      id: `TEST${Date.now()}`,
      userId: 1,
      items: [
        {
          product: {
            id: 1,
            name: '测试商品',
            description: '测试商品描述',
            price: 999.00,
            stockQuantity: 100,
            categoryId: 1,
            imageUrl: 'https://via.placeholder.com/300x300?text=测试商品',
            salesCount: 0,
            status: 1,
            createdAt: new Date().toISOString(),
            updatedAt: new Date().toISOString(),
            categoryName: '测试分类'
          },
          quantity: 1
        }
      ],
      totalAmount: 999.00,
      status: 'PENDING_PAYMENT',
      createdAt: new Date().toISOString(),
      addressId: 1,
      paymentMethod: 'credit_card'
    };
    
    const updatedOrders = [newOrder, ...orders];
    localStorage.setItem('orders', JSON.stringify(updatedOrders));
    setOrders(updatedOrders);
    message.success('测试订单已创建');
  };
  
  // 清空订单
  const handleClearOrders = () => {
    Modal.confirm({
      title: '确认清空订单',
      content: '您确定要清空所有订单吗？',
      onOk: () => {
        localStorage.removeItem('orders');
        setOrders([]);
        message.success('订单已清空');
      }
    });
  };
  
  return (
    <div style={{ padding: '20px' }}>
      <h1>订单测试页面</h1>
      
      <div style={{ marginBottom: '20px' }}>
        <Button type="primary" onClick={handleCreateTestOrder} style={{ marginRight: '10px' }}>
          创建测试订单
        </Button>
        <Button danger onClick={handleClearOrders} style={{ marginRight: '10px' }}>
          清空所有订单
        </Button>
        <Button onClick={() => navigate('/orders')}>
          返回订单列表
        </Button>
      </div>
      
      <Card title={`订单列表 (${orders.length})`}>
        <List
          dataSource={orders}
          renderItem={(order: any) => (
            <List.Item
              actions={[
                <Button 
                  danger={order.status !== 'CANCELLED'} 
                  disabled={order.status === 'CANCELLED'}
                  onClick={() => handleCancelOrder(order.id)}
                >
                  {order.status === 'CANCELLED' ? '已取消' : '取消订单'}
                </Button>
              ]}
            >
              <List.Item.Meta
                title={`订单ID: ${order.id}`}
                description={`状态: ${order.status}, 金额: ¥${order.totalAmount}`}
              />
            </List.Item>
          )}
        />
      </Card>
    </div>
  );
};

export default TestOrderPage;
